Bye Pumkin is a rewind podcast for niche trash reality tv shows. Host by Princess Jones Curtis (Spelling T, How to Get Fired on Your Day Off, Bitch Blog) this podcast aims to take deep dives into shallow pools. New episodes drop every Sunday morning. The first season starts Oct 27th and covers the first season of Flavor of Love.  

